import React from 'react';
import './App.css';
import Login from "./login/Login";
import { Routes, Route } from 'react-router-dom';

function App() {
  // componentDidMount() {
  //   fetch('/api')
  //     .then(res => res.text())
  //     .then(text => console.log(text));
  // }

  return (
    <div className="wrapper">
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </div>
  )
}

export default App;
